import React, { Component } from 'react';

class NewIdeaForm extends Component {
  constructor() {
    super();

    this.state = {
      ideaTitle: '',
      ideaBody: ''
    }

  }

  render() {
    return(
      <form>
        <input type='text' value={this.state.ideaTitle} />
        <input type='text' value={this.state.ideaBody} />
        <button>Submit</button>
      </form>
    )
  }
}

export default NewIdeaForm;
